import './App.css';
import Card from './Card';

function App() {
  return (
    <div className="App">
      <Card
        discription="Stay up to speed about the upcoming, limited-edition Mustang® 60th Anniversary Package. Exclusive to the 2025 Mustang® GT Premium coupe and convertible"
        name="Mustang"
        url="https://images.unsplash.com/photo-1494976388531-d1058494cdd8?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
      />
      <Card
        discription="Skyscraper Gray Metallic 2024 BMW 3 Series 330i xDrive AWD 8-Speed Automatic Sport 2.0L 4-Cylinder DOHC 16V Turbocharged"
        name="B M W"
        url="https://images.unsplash.com/photo-1580273916550-e323be2ae537?q=80&w=1064&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
      />
      <Card
        discription="The Tata Nano is a city car/microcar manufactured and marketed by Indian automaker Tata Motors over a single generation from 2008–2018, primarily in India, as an inexpensive rear-engine hatchback for motorcycle and scooter drivers — with a launch price of ₹100,000 (US$2,500 )"
        name="TATA NENO"
        url="https://news24online.com/wp-content/uploads/2023/10/Untitled-15-1.jpg"
      />
    </div>
  );
}

export default App;
